module.exports = {
  extends: ['mifi'],
  rules: {
    'jsx-a11y/click-events-have-key-events': 0,
    'jsx-a11y/interactive-supports-focus': 0,
    'jsx-a11y/control-has-associated-label': 0,
  },

  overrides: [
    {
      files: ['./src/renderer/**/*.{js,cjs,mjs,jsx,ts,tsx,mts}'],
      env: {
        node: false,
        browser: true,
      },
      rules: {
        'no-console': 0,
        'import/no-extraneous-dependencies': 0,
      },
    },
    {
      files: ['./src/preload/**/*.{js,cjs,jsx,ts,tsx}'],
      env: {
        browser: true,
      },
      rules: {
        'no-console': 0,
      },
    },
    {
      files: ['./script/**/*.{js,cjs,mjs,jsx,ts,tsx,mts}', 'electron.vite.config.ts'],
      rules: {
        'import/no-extraneous-dependencies': ['error', {
          devDependencies: true,
          optionalDependencies: false,
        }],
      },
    },
  ],
};

import { defineConfig, externalizeDepsPlugin } from 'electron-vite';
import react from '@vitejs/plugin-react';


export default defineConfig({
  main: {
    // https://electron-vite.org/guide/dev#dependencies-vs-devdependencies
    // For the main process and preload, the best practice is to externalize dependencies and only bundle our own code.
    // However, until we use ESM for electron main, we need to include ESM-only deps in the bundle: (exclude from externalize)
    plugins: [externalizeDepsPlugin({ exclude: ['p-map', 'execa', 'nanoid', 'file-type'] })],
    build: {
      target: 'node20.18',
      sourcemap: true,
    },
  },
  preload: {
    // https://electron-vite.org/guide/dev#dependencies-vs-devdependencies
    plugins: [externalizeDepsPlugin({ exclude: [] })],
    build: {
      target: 'node20.18',
      sourcemap: true,
    },
  },
  renderer: {
    plugins: [react()],
    build: {
      target: 'chrome130',
      sourcemap: true,
      chunkSizeWarningLimit: 3e6,
    },
    server: {
      port: 3001,
      host: '127.0.0.1',
    },
  },
});

// eslint-disable-line unicorn/filename-case
export default {
  input: ['src/renderer/**/*.{js,jsx,ts,tsx}', 'src/main/*.{js,ts}'],

  output: 'locales/$LOCALE/$NAMESPACE.json',
  indentation: 4,

  sort: true,

  locales: ['en'],

  lexers: {
    js: ['JavascriptLexer'],
    jsx: ['JsxLexer'],
  },

  defaultValue: (lng, ns, key) => key,

  // Keep in sync between i18next-parser.config.js and i18nCommon.js:
  keySeparator: false,
  namespaceSeparator: false,
};

{
  "references": [
    { "path": "./tsconfig.web.json" },
    { "path": "./tsconfig.main.json" },
    { "path": "./tsconfig.node.json" },
  ],
  "files": [],
}

{
  "extends": ["@tsconfig/strictest", "@tsconfig/node20/tsconfig.json"],
  "compilerOptions": {
    "noEmit": true,
  },
  "include": [
    "script/**/*",
  ],
}

{
  "extends": ["@tsconfig/strictest", "@tsconfig/vite-react/tsconfig.json"],
  "compilerOptions": {
    "lib": ["ES2023", "DOM", "DOM.Iterable"],
    "noEmit": true,

    "noImplicitAny": false, // todo

    "types": ["vite/client"],
  },
  "references": [
    { "path": "./tsconfig.main.json" },
  ],
  "include": [
    "src/renderer/**/*",
  ],
}
